import React from 'react'
import './AboutImages.css'

function RealDeal() {
    return (
        <div className='Midpage'>
        <img  id='Real_Deal_Desktop_Image' className='About_Page_Desktop' src='./images/image-real-deal.jpg' alt=""/>
        <img className='About_Page_Tablet' src='./images/tablet-real-deal.jpg' alt=""/>
        <img className='About_Page_Mobile' id='Mobile-ReadDeal==' src='./images/mobile-real-deal.jpg' alt=""/>  
        </div>
    )
}

export default RealDeal
